        {wallet._id}
      </Typography>
      <Typography variant="body2">
        {`${wallet.balance} ${wallet.currency}`}
      </Typography>
      </Box>
    </CardContent>
    <CardActions>
      <Button size="small">Add money</Button>
      <Button size="small">Transfer money</Button>
    </CardActions>
  </>
);



export default function OutlinedCard() {
  return (
    <Box sx={{ minWidth: 275 }}>
      <Card variant="outlined">{card}</Card>
    </Box>
  );
}
